class Solution(object):
	def totalFruit(self, tree):
		"""
		在一排树中，第 i 棵树产生 tree[i] 型的水果。
		你可以从你选择的任何树开始，然后重复执行以下步骤：
		把这棵树上的水果放进你的篮子里。如果你做不到，就停下来。
		移动到当前树右侧的下一棵树。如果右边没有树，就停下来。
		请注意，在选择一颗树后，你没有任何选择：你必须执行步骤 1，然后执行步骤 2，然后返回步骤 1，然后执行步骤 2，依此类推，直至停止。
		你有两个篮子，每个篮子可以携带任何数量的水果，但你希望每个篮子只携带一种类型的水果。
		用这个程序你能收集的水果总量是多少？
		---
		输入：[1,2,1]
		输出：3
		解释：我们可以收集 [1,2,1]。
		---
		输入：[0,1,2,2]
		输出：3
		解释：我们可以收集 [1,2,2].
		如果我们从第一棵树开始，我们将只能收集到 [0, 1]。
		---
		输入：[1,2,3,2,2]
		输出：4
		解释：我们可以收集 [2,3,2,2].
		如果我们从第一棵树开始，我们将只能收集到 [1, 2]。
		---
		双指针
		标志 水果类型不能超过两个
		:type tree: List[int]
		:rtype: int
		"""
		if len(set(tree)) <= 2:
			return len(tree)
		n = len(tree)
		max_count = 0
		i = 0
		while i < n:
			flag = []
			count = 0
			j = i
			while j < n:
				if tree[j] in flag :
					count += 1
				elif tree[j] not in flag and len(flag) < 2:
					count += 1
					flag.append(tree[j])
				elif tree[j] not in flag and len(flag) == 2:
					break
				j += 1
			if count > max_count:
				max_count = count
			i += 1
		return max_count

